import type { ISvgProps } from "../../types/commom";

export const Bacon = ({ width, height }: ISvgProps) => {
  return (
    <svg
      width={width ?? "100"}
      height={height ?? "100"}
      viewBox="0 0 100 100"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
    >
      <rect width="100" height="100" fill="url(#pattern0_6_11)" />
      <defs>
        <pattern
          id="pattern0_6_11"
          patternContentUnits="objectBoundingBox"
          width="1"
          height="1"
        >
          <use
            xlinkHref="#image0_6_11"
            transform="translate(0 -0.125) scale(0.000925926)"
          />
        </pattern>
        <image
          id="image0_6_11"
          width="1080"
          height="1350"
          preserveAspectRatio="none"
          xlinkHref="data:image/png;base64,"
        />
      </defs>
    </svg>
  );
};
